import React from 'react';

const SearchBar = () => {
  return (
    <div className="search-bar-container">
      <input
        type="text"
        placeholder="Search for books..."
        className="search-input"
      />
      <button className="search-button">
        Search
      </button>
    </div>
  );
};

export default SearchBar;
